import React, { Component } from 'react';
import { connect } from 'react-redux';
import { buildEnhancedStat } from './../../utils/stats.js';

class Masterworks extends Component {

	render(){
		const {
			props: {
				manifest,
				weapon
			}
		} = this;

		return (
			<div className="weapon__tab weapon__masterworks">
				<span className="uppercase tracked-wide underline">Masterworks</span>
				{ 
					// console.log(manifest.DestinyInventoryItemDefinition[weapon.hash]) 

						buildEnhancedStat(
							manifest,
							manifest.DestinyInventoryItemDefinition[202670084]
						)

				}


			</div>
		)
	}
}

const mapStateToProps = state => ({
	manifest: state.manifest,
	weapon: state.weapon,
});

export default connect(mapStateToProps, {

})(Masterworks);
